import React from 'react';
import {useSelector} from "react-redux";

const Timeline = () => {

    const users = useSelector(state => state.users.users)


    return (
        <>
            <ul>
                {
                    users.map(user => <li>{user.name}</li>)
                }
            </ul>
        </>
    )
};

export default Timeline;
